INSERT INTO `wp_wc_admin_notes` VALUES (90,'ipp_refresh_q2_2023_us_inbox_notification','marketing','en_US','Grow on the go with in-person payments','Sell your products or services on the go with the M2 card reader – a quick, synchronized, and secure way to take payments, no matter where you are. Create an order using the WooCommerce mobile app and connect your card reader to accept payments.','{}','pending','woocommerce.com','2023-07-23 14:57:33',NULL,0,'plain','',0,0,'info');
