INSERT INTO `wp_wc_admin_notes` VALUES (92,'woocommerce-WCstripe-May-2023-updated-needed','update','en_US','Action required: Security update of WooCommerce Stripe plugin','<strong>Your store requires a security update for the WooCommerce Stripe plugin</strong>. Please update the WooCommerce Stripe plugin immediately to address a potential vulnerability.','{}','pending','woocommerce.com','2023-07-23 14:57:33',NULL,0,'plain','',0,0,'info');
